import React from 'react'

class Pokemon extends React.Component {
    render() {
        const {name, type} = this.props.pokemonData;
        return (
        <>
            <p className='name'>{ name }</p>
            <p className='type'>{ type }</p>
        </>
        )
    }
}

export default Pokemon;
